declare namespace org {
    namespace bukkit {
        /**
         * Represents a String based key which consists of two components - a namespace
         * and a key.
         * Namespaces may only contain lowercase alphanumeric characters, periods,
         * underscores, and hyphens.
         * <p>
         * Keys may only contain lowercase alphanumeric characters, periods,
         * underscores, hyphens, and forward slashes.
         */
        // @ts-ignore
        class NamespacedKey extends java.lang.Object {
            /**
             * Create a key in a specific namespace.
             * @param namespace namespace
             * @param key key
             * @deprecated should never be used by plugins, for internal use only!!
             */
            // @ts-ignore
            constructor(namespace: string, key: string)
            /**
             * Create a key in the plugin's namespace.
             * <p>
             * Namespaces may only contain lowercase alphanumeric characters, periods,
             * underscores, and hyphens.
             * <p>
             * Keys may only contain lowercase alphanumeric characters, periods,
             * underscores, hyphens, and forward slashes.
             * @param plugin the plugin to use for the namespace
             * @param key the key to create
             */
            // @ts-ignore
            constructor(plugin: org.bukkit.plugin.Plugin, key: string)
            /**
             * The namespace representing all inbuilt keys.
             */
            // @ts-ignore
            readonly MINECRAFT: string
            /**
             * The namespace representing all keys generated by Bukkit for backwards
             * compatibility measures.
             */
            // @ts-ignore
            readonly BUKKIT: string
            // @ts-ignore
            getNamespace(): java.lang.String
            // @ts-ignore
            getKey(): java.lang.String
            // @ts-ignore
            hashCode(): int
            // @ts-ignore
            equals(obj: any): boolean
            // @ts-ignore
            toString(): java.lang.String
            /**
             * Return a new random key in the {@link #BUKKIT} namespace.
             * @return new key
             * @deprecated should never be used by plugins, for internal use only!!
             */
            // @ts-ignore
            randomKey(): org.bukkit.NamespacedKey
            /**
             * Get a key in the Minecraft namespace.
             * @param key the key to use
             * @return new key in the Minecraft namespace
             */
            // @ts-ignore
            minecraft(key: string): org.bukkit.NamespacedKey
        }
    }
}
